import React from "react";
import { Grid, Paper, Typography } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import TrendingUpIcon from "@material-ui/icons/TrendingUp";
import TrendingDownIcon from "@material-ui/icons/TrendingDown";
import coe from "../coeInfo";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    justifyContent: "center",
  },
  paper: {
    width: 300,
    height: 200,
  },
  itemContent: {
    justifyContent: "center",
  },
  cat: {
    textAlign: "center",
  },
  desc: {
    textAlign: "center",
  },
  premium: {
    textAlign: "center",
  },
}));

const CoeInfo = () => {
  const classes = useStyles();
  return (
    <Grid container className={classes.root} spacing={1}>
      {coe.map((item, index) => (
        <Grid item key={index}>
          <Paper
            variant="outlined"
            square
            className={classes.paper}
            elevation={3}
          >
            <Grid container className={classes.itemContent}>
              <Grid item>
                <Typography className={classes.cat} variant="h6">
                  {item.category}
                  <Typography variant="subtitle2" className={classes.desc}>
                    ({item.descriptions})
                  </Typography>
                </Typography>
              </Grid>
            </Grid>
            <Grid container justifyContent="center">
              <Grid item>
                {item.premium.current > item.premium.previous ? (
                  <TrendingUpIcon style={{ color: "green" }} />
                ) : (
                  <TrendingDownIcon color="secondary" />
                )}
              </Grid>
              <Grid item>
                <Typography className={classes.premium}>
                  ${item.premium.current}
                </Typography>
              </Grid>
            </Grid>
          </Paper>
        </Grid>
      ))}
    </Grid>
  );
};

export default CoeInfo;
